    description:
      "** Please register your interest in the enquiry field below so we can keep you informed if the property is to be sold before the next inspection.\n\nThe big picture. \n\nThis grand residence is a work of art. Designed by award-winning architects JCB, this stunning, 743sqm, two-storey home is crafted entirely from toxin-free materials. Plus, there's breathtaking, north-facing, seasonal gardens and the views over the Yarra River valley. Oh, and did you see the pool? \n\nThe finer details. \n\nThe verdant beauty extends inside with the natural, custom and handmade finishes throughout - including handblown glass light fittings. The open plan living and dining area beautifully captures impressive views but the best place to enjoy the vistas is from the conservatory leading to the stoned-walled garden room. \n\nThe extras.\n\nThe residence is located within a tightly-held Studley Park enclave opposite the Yarra Bend Park. This means there are many choices for Saturday picnics using fresh ingredients from the caf\u00c3\u0192\u00c2\u00a9s and providores of Kew Junction, which is only a few minutes away. This perfectly situated home is also nearby to many of the city's best schools, as well as Eastlink. \n\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tApprox. 743sqm of land\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tMature, seasonal, north-facing gardens\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tMaster bedroom with home cinema, his and her fitted dressing rooms, and heated floors\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tItalian, aged brass fittings\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tAmerican Oak joinery\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tHandmade tiles throughout \n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tCustom-made brass fly screens\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tCommissioned handblown glass light fittings\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tConcrete benchtops hand poured on site\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tNatural paint\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tTriple filtered water system \n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tNatural timbers\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tArtisan-crafted wrought-iron balustrades\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tAustralian bluestone balcony\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tPergola crafted from single reclaimed timber beams \n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tAga cast iron cooker\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tIntegrated refrigerator \n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tItalian porcelain sink with insinkerator \n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tCoffee bar\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tFruit trees in garden\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tGround floor fourth bedroom or study\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tFitted laundry\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tTriple remote garage\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tSensor lighting\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tAutomated irrigation\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tIntegrated lighting\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tPure alpaca wool carpets\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tIntegrated sound system\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tZoned reverse-cycle heating and air conditioning \n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tSaltwater, heated swimming pool\n\u00c3\u00a2\u00c2\u20ac\u00c2\u00a2\tVideo intercom",
