      "The big picture.\n\nGracing beautiful landscaped gardens lined with heightening trees this new contemporary residence of impressive proportions over 3-levels, is bathed with an abundance of natural light from expansive windows and floor-to-ceiling glass walls; constructed with a commitment to quality and brilliantly located in the Scotch Hill precinct.\n\nThe finer details.\n\nThe quiet, gallery-like interior features a striking white and grey themed décor, high ceilings and herringbone parquetry flooring flowing through the entrance foyer to a downstairs bedroom with WIR/ensuite, sitting room, wine room and powder room. Through to a stunning open-plan informal living domain incorporating a state-of-the art prestige Gaggenau/marble kitchen with a butler's pantry and laundry. All opening to an outdoor alfresco entertaining area with pool and gas mains barbeque kitchen \u00e2\u20ac\u201c perfect for year round indoor/outdoor entertaining.\n\nThe extras.\n\nThe upstairs area has a huge retreat and four further bedrooms, three with ensuites plus a family bathroom \u00e2\u20ac\u201c a sumptuous master includes a dressing room and balcony. Leading through a remote Gorter roof hatch to a 3rd level, rooftop entertaining area complete with a 2nd gas mains barbeque kitchen and City skyline glimpses.\n\nIn conjunction with Nick Ptak - 0413 370 442",
