    description:
      "The big picture.\n\nThis regal beauty has stayed away from the limelight up until now. A Victorian inspired Edwardian home built in 1903, it hasn't been offered on the market in 24 years. Expansive in size (616sqm in fact) but cosy in feel, the home's recent renovations have seen the inclusion of a conservatory, study and pool. Pass me that Manhattan won't you?\n\n\nThe little details.\n\nNow, we don't use the term 'magnificent' lightly, but period features including towering ceilings, leadlight windows, detailed brass door accessories, and Baltic pine floors make an incredible first impression. And the crowning jewel? An open plan kitchen, living area and dining room conservatory where you can savour your morning poached eggs while basking in the sun or as the rain patters gently on the glass ceiling.\n\n\nThe extras.\n\nYes, it's exclusive. Tucked away on one of the most tightly held cul-de-sacs in a close-knit part of Camberwell, 26 Moorhouse Street brims with leafy charm, typical of the area. If you tire of the serenity, Camberwell Junction is just a ten-minute walk away \u00e2\u20ac\u201c so you can dine, shop and enjoy the latest blockbusters to your heart's content.\n\n• North West orientation\n• Front driveway + front and back off street parking\n• Excellent access to shops, schools and public transport\n• Five minutes walk from East Camberwell station\n• Master bedroom with en suite and walk in robe\n• Additional bedrooms with built in storage",
