      "The big picture.\n\nSay hello to a natural beauty with a fresh new look. This luxurious, generously sized 5 bedroom home was completely refurbished by Tracy Bufe only 12 months ago, and features expansive living and dining areas that open to a private hedged garden with large terraces sitting on approx 1,106sqm. Garden party anyone?\n\n\nThe little details.\n\nIf a quiet cuppa with a book is more your style, a study overlooking the garden, a formal sitting room opening to a balcony, and a living room with a Jetmaster fireplace are all perfect places to get cosy. And for your inner Michelin star chef, a state-of-the-art kitchen allows you to craft amazing culinary delights. Bon appétit!\n\n\nThe extras.\n\nLeaves. Plants. Gardens. Parks. You'd be hard pressed to find a more verdant address than 9 Ferncroft Avenue. Standing on a tree-lined street, and with Hedgely Dene Garden only two doors down, this beautiful home is surrounded front and back by lawns and gardens. Oh, and don't forget it's only a short stroll to Darling Station, Wattletree Road and Central Park too.\n\n• Large entrance hall with limed oak floors\n• Miele appliances\n• Soft-closing cabinetry\n• Stone benches\n• Master bedroom with designer en suite and walk-in robe\n• Additional bedrooms with built-in robes\n• Basement storage or cellar\n• Double garage\n• Designer lighting\n• Italian tiles\n• Powder room",
