    description:
      "The big picture.\n\nHome should feel like your own slice of paradise, and this spectacular residence is simply heavenly. Positioned on one of the highest hills in Kew, this contemporary tri-level home opens to breath taking views from all levels. With stunning architecture and two separate garden areas, one featuring a pool, this is your secret oasis of calm in the tightly held Studley Park enclave opposite Yarra Bend Park\n\n\nThe little details.\n\nOn the lower level a private sauna is the perfect place to unwind. Two open deck areas, a verandah overlooking the pool, open plan kitchen, dining, living and family rooms with floor-to-ceiling windows allow you to enjoy dinner watching the setting sun. And don't forget the little touches that elevate your daily life \u00e2\u20ac\u201c the abundant native birds, blooming gardenias and the views over the Yarra River \u00e2\u20ac\u201c all this just a few minutes' drive to the CBD.\n\n\nThe extras.\n\nIf two magnificent garden areas are not enough, it's only a short stroll to the Yarra River trails, boat houses and Collingwood Children's farm. A spot of golf perhaps? Yarra Bend has the largest remaining area of native bushland in inner Melbourne and some of Melbourne's leading schools are nearby. It's proximity to EastLink, public transport, Kew Junction and Willsmere village are an added bonus.\n\n• Master bedroom with walk-in robe and en suite\n• Stainless Steel kitchen\n• Powder room\n• Concealed laundry\n• Solar pool heating with remote control lighting\n• Two double auto garages\n• Ducted heating, cooling and vacuum\n• In Built alarm system\n• Polished Tasmanian Myrtle floorboards\n• Huge well fitted study\n• 1,034 sqm block\n• 2nd lounge area on lower level\n• Independent guest wing\n• Sensor lighting",
