    description:
      "The big picture.\n\nWe hope you have the good china ready, because this is a home that's all about gatherings. This expansive two-storey residence with a free-flowing floorplan has all the space to accommodate. A lounge with an open fireplace is ideal for winter warmers, while an enormous family room that opens to a private, north facing landscaped garden is perfect for indoor-outdoor get-togethers.\n\n\nThe little details.\n\nChefs and bakers prepare to be delighted by the gourmet kitchen with stainless steel benches and ample storage space. A fourth bedroom can be converted into a study, and both the master bedroom with full en suite and the two double bedrooms offer plenty of space. But the final treat? A luxurious outdoor heated plunge pool.\n\n\n\nThe extras.\n\nNow this is an address that truly lives up to its A-grade position. Located in a highly sought-after pocket of Hawthorn East right in the heart of the Anderson Park precinct. Bonfield Avenue runs parallel to Burke Road, where it's only a few tram stops to Camberwell Junction. The many delights of Auburn Village are also only a short stroll away. What more could you want?\n\n• Heated plunge pool\n• Formal and informal living areas\n• Double lock up garage\n• Bedrooms with built in wardrobes\n• Brush box floors\n• Ducted heating\n• Air conditioning\n• Security alarm system\n• Private high fence",
