    description:
      "The big picture.\n\nWhere do we start? Situated in Hawthorn's enviable St James Park Estate there's just so much to say about this beautiful home. Set on 892sqm of gardens, this double fronted 1892 Victorian residence blends heritage features with luxurious finishes and appliances. The main open plan living and dining space offers incredible flexibility which opens onto the leafy alfresco area - so we expect garden parties galore come summer.\n\n\nThe little details.\n\nThe single-level residence's fifth bedroom can be transformed into a private study, or even a third living area (with its charming fireplace, we recommend the last option). The master bedroom boasts an Italian marble en suite with free-standing bath, a walk-in robe, and a private courtyard \u00e2\u20ac\u201c perfect for a tranquil morning meditation or cup of tea.\n\nPrepare your daily feast in a stunning chef's space that features a marble benchtop, European appliances and custom cabinetry (because a beautiful kitchen is always the secret ingredient).\n\n\nThe extras.\n\nHow to best pass a Saturday? A walk along the river, or browsing Hawthorn's celebrated boutiques? The Yarra River is just a minute away and Hawthorn Station is only a stroll from home (did someone say brunch?). St James Park is just a six-minute walk from your front door - perfect for a picnic or a run with the dog.\n\n• Approximately 892sqm of land\n• Tessellated return verandah\n• Lawns in addition to paved area\n• Hydronic heating\n• Reverse cycle heating and cooling\n• Underground cellar with 1000 bottle capacity\n• Studio that can be made into a gym\n• Double glazing\n• Acoustic fence\n• Attic storage\n• Solar panels\n• Auto-irrigation system\n• Outdoor sound system\n• Outdoor lighting system\n• Cubby house\n• Intercom and alarm\n• Secure outdoor storage area\n• Tandem off-street parking",
