    description:
      "The big picture.\n\nThey say luxury is timeless, don't they? This Edwardian stunner is filled with touches of opulence. Covering approximately 615sqm, the grounds include manicured gardens, lawns and a timber terrace (with a built-in barbecue, and, yes, a spa!) perfect for outdoor entertaining. Or, if it's a little chilly, blast that gas coal-fire in the spacious open plan living, dining, kitchen and family room. Toasty.\n\nThe little details.\n\nKick-off your shoes and spread out. In addition to the main living and kitchen area, a ground floor sitting room and study and an upstairs living room provide the perfect retreat for a cup of tea. High ceilings and Baltic Pine floors are reminiscent of the period, and stone benches, a walk-in pantry and Smeg appliances enhance the impressive chef's kitchen. How divine.\n\nThe extras.\n\nIt doesn't get more 'leafy Camberwell' than a park at the end of your street: Highfield Park is visible from the front entrance. Riversdale Road runs behind this green space, taking you to Riversdale Station and Camberwell Junction in just a few tram stops. And with Wattle Park just over 1km away, you'll never have an excuse not to get outdoors. Although, we know it's hard to leave the spa.\n\n• North-facing living area with bi-fold doors to terrace\n• Master bedroom with ensuite and walk-in robe\n• Two powder rooms\n• Two further bedrooms with built-in robes\n• Hydronic heating\n• Reverse cycle air conditioning\n• Alarm\n• Video intercom\n• Solar panels\n• 5000-litre rainwater tank and drip irrigation system\n• Wine cupboard\n• Auto-gates and internally accessed double garage",
