    description:
      "The big picture.\n\nThe perfect blend of heritage charm and modern luxury! Set on a deep block, this single fronted, two-storey Victorian residence offers a lovely façade framed by a traditional laced verandah and complemented by a delightful, leafy front garden. Step inside the arched hallway to be greeted by an abundance of beautiful period features including soaring ceilings with roses, cornices and original fireplaces in the two downstairs bedrooms.\n\nBeyond the hallway, a wow-factor transformation awaits with an expansive kitchen, dining and living space of contemporary design and high quality. This sensational, light-filled area is the heart of the home, opening to a huge paved courtyard complete with established gardens and a built-in gas barbecue. It's the ideal sanctuary for gatherings of any size with family and friends. A stunning family bathroom, concealed laundry and heated drying cabinet complete the ground floor.\n\nA new timber staircase leads to two further bedrooms, both large, including the master with ensuite and walk-in robe.\n\n\nThe little details.\n\nThe superbly appointed designer kitchen will delight both the home cook and the gourmet chef alike! It showcases a huge stone island benchtop, a massive carrara marble splashback feature wall, sleek cabinetry with an integrated fridge, Miele appliances, (including double ovens and five-zone induction cooktop) and a butler's pantry with an oversized wood feature door.\n\nThe adjacent living space has a bank of tall sliding doors and a stunning custom fireplace, perfect for cosy winter nights. Other features include zoned heating and cooling, wide European oak floorboards, premium wool carpets and built-in robes in all bedrooms, an abundance of storage space, ceiling speakers and remote control off-street parking.\n\n\nThe extras.\n\nA quiet, leafy street surrounded by the best of Camberwell \u00e2\u20ac\u201c how does that sound? Camberwell Junction, with its array of shops, cafes, restaurants, supermarkets, the famed fresh food market and the historic Rivioli cinema, is literally a few minutes' walk away.\n\nFamily-friendly parks are also close-by, including Riversdale Park and Camberwell Sports Ground. Fantastic public transport options with tram stops at both ends of the street and Camberwell rail station within walking distance.\n\nZoned for Camberwell Primary, Camberwell High and Canterbury Girls' schools and easy access to an array of private schools.",
