    description:
      "The big picture.\n\nIf big is beautiful, then this residence is most certainly a Botticelli Angel. A stately French Provincial on the outside and a cutting-edge fashion statement on the inside, the biggest question on everyone's lips will be \"What shall I do today?\" Maybe a dip in the shimmering pool or watching a movie in the basement theatre? How about enjoying a city sunset view atop Anderson Park or just strolling down the street to dine at Camberwell Junction?\n\nThe finer details.\n\nWith expansive living zones on all three levels, everyone in the family can choose their own lifestyle adventure. Plantation shutters, soaring ceilings and European Oak floors are a luxurious backdrop, harmonising with the full compliment of Miele appliances in the kitchen and second kitchen. Luxuriate in the hotel quality of every bathroom, featuring the finery of Villeroy and Boch, Grohe and floor-to-ceiling marble.\n\nThe extras.\n\nSurrounded by the magical allure of tree-lined avenues, your family will adore wandering along them to renowned schools such as Auburn South Primary, Auburn High, Bialik College, Scotch College and St Kevin's College. Working in the city is a breeze with nearby trams and trains to get you there on time, but on the weekends just jump on the freeway and drive down to the Mornington Peninsula for some sun, sand, wine and relaxation.\n\n• Exceptional five bedroom, five bathroom floorplan\n• Five distinct and absolutely breathtaking living zones\n• A huge master bedroom with walk-in robe and free-standing tub ensuite\n• A convenient ground floor guest suite\n• Under-cover alfresco overlooking a deep azure pool with water wall\n• Basement cellar, bar and powder room\n• Three car auto garage with auto gate\n• Central heating/air-conditioning, ducted vacuum and security",
