    description:
      "The big picture.\n\nSet on one of the bigger land holdings in the estate, this is a visionary architecture in a uniquely elevated setting. With panorama across the Yarra River tree-tops and out to Kinglake, this luxurious residence melds the finest in design and craftsmanship. Indoor and outdoor spaces weave into one another across multiple levels, from the bedrooms adjoining private courtyards to the multiple living areas opening onto expansive terraces and an atrium.\n\nThe little details.\n\nAmateur chefs will adore the open plan dining, lounge and kitchen area, fitted with Miele appliances and stone island benchtop, where they can prepare the locally-sourced treats while admiring the vistas. The master bedroom offers a spacious walk-through robe and marble ensuite with a dual shower (and vanity), while the ground floor living and dining room is enhanced by a gas fireplace.\n\nThe extras.\n\nA residence surrounded by greenery. Starting with a reserve at your doorstep, you're only a 1km stroll to the Yarra River and its many parklands. Doubtless, many weekends will be spent enjoying family walks or taking in the views with a glass of Prosecco. Kew Junction is just over 1km down Princess Street, and you're surrounding by some of the finest private schools in Melbourne; Xavier, MLC, Trinity and Scotch just to name a few.\n\n• 488sqm of land approx.\n• Spotted gum floor boards\n• NABERS energy 6.5 star rating\n• Rare, elevated position with views\n• Refrigerated air conditioning\n• Solar panels\n• 3 living areas\n• Feature stairway\n• Miele 900mm oven\n• Heat & Glo gas fireplace on ground level\n• Park-facing window-wall in master bedroom\n• Broad landing on upper floor can be used as a study\n• Secondary bedrooms feature built-in robes\n• Rumpus/cinema room that opens to north-facing courtyard",
