    description:
      "The big picture.\n\nFrom its verdant gardens to its light-filled interiors, this 1930's home is stunning to behold from every angle. A spacious, open plan kitchen and living room that connects to an impeccable dining room all offer a north-facing orientation to maximise on light. The living room also opens to a breathtaking back courtyard, ideal for summer soirées and impromptu get-togethers.\n\nThe little details.\n\nLittle touches of opulence are scattered throughout the residence in the period features, such as ceiling mouldings and a magnificent fireplace in the dining room. Those looking for a quiet nook to enjoy a cup of herbal brew can escape to the front veranda, which overlooks the manicured front garden bursting with colour all year round.\n\nThe extras.\n\nIf lush gardens at home aren't quite enough greenery, Surrey Park is just over the road \u00e2\u20ac\u201c perfect for morning jogs and Sunday picnics with the family. The adjacent Riversdale Road offers trams to the city and takes you to Camberwell Junction in just over 10 minutes. For easy morning brunches, a number of charming cafés are within a short stroll from the residence.\n\n• Double carport\n• 1000 bottle wine cellar\n• Roof storage\n• Heating and cooling\n• Tiled private back courtyard with partial coverage\n• Two fireplaces",
