    description:
      "The big picture.\n\nCome on a journey which began a century ago and ends in a modern tropical oasis. With an impressively maintained 1920s façade, this two-storey residence sits in stunning 784m2 grounds. The manicured front garden flows through to a rear outdoor area which includes a pool and spa, pavilion, generous lawn and play space, separate paved barbeque area, lush foliage and our favourite, full-sized palm trees.\n\nThe finer details.\n\nThe residence itself offers a variety of complementary living spaces. An expansive, open-plan kitchen, dining, living area, flowing directly to the outdoors, is ideal for larger celebrations. Otherwise quiet time can be enjoyed in the generous, light-filled lounge with its high ceilings and open fireplace. The equally generous home office provides a serene workspace overlooking the front garden and benefits from natural light throughout the day. The final downstairs room provides flexibility and has been used variously as a dining room, guest room, playroom, bedroom and now separate TV space as family needs have changed over the years. Upstairs the master suite comprises a generous bedroom overlooking the pool and palm trees, ample built-in robes and an en-suite with free-standing bath. The family bathroom is divided into separate spaces for the shower, WC and basin to facilitate streamlined mornings and services the three additional upstairs bedrooms leading off the central landing, each with a walk-in robe.\n\nThe extras.\n\nWe don't think we could have chosen a more fitting address for this luxurious home. Standing on a grand, leafy street quintessential to this pocket of Hawthorn East, the residence lies halfway between Toorak Road and Camberwell Junction \u00e2\u20ac\u201c you can enjoy Saturday shopping trips, Sunday brunch or films at the Rivoli before strolling home. Anderson Park and Burke Road trams are also just moments away.\n\n• North-facing with deciduous summer shade\n• Shade awnings to upstairs bedroom windows\n• Original stained glass features\n• Stained and polished original timber floors\n• Downstairs cloakroom and shower\n• Gas ducted heating downstairs with evaporative cooling in the kitchen/dining/living area\n• Reverse cycle heating/cooling to upstairs rooms\n• Walk-in pantry with recycling chute\n• Laundry with drying racks and direct access to outdoor utility area\n• 3.9Kw Solar power\n• Fenced solar and/or gas heated saltwater pool and spa with waterfall and slide\n• Cubby house\n• Water tank",
