    description:
      "The big picture.\n\nWith its magnificent heritage facade and impressive street presence, this iconic 1889 Victorian terrace \"Collingwood\" is one of Clifton Hill's finest homes and a rare offering. Soaring ceilings and other glorious period features balance brilliantly with a modern rear transformation. Light, space and a perfect layout for the growing family.\n\nThe little details.\n\nEntertain in style in the elegant formal rooms, resplendent with original fireplaces. Relax in the open-plan family domain with its marble kitchen and living room boasting a striking glass ceiling. Throw open the back doors to an inviting deck and deep garden for summertime gatherings. Or just enjoy some quiet downtime in the charming side courtyard. With so many options, you're living the dream!\n\nThe extras.\n\nUnrivalled for convenience and lifestyle. How's this list? St Johns and Clifton Hill Primary schools, trams and trains, Eastern Freeway access, Darling Gardens, Fitzroy Pool and Collingwood Leisure Centre - ALL a stone's throw away. Plus, the shops, café culture and local village atmosphere of nearby Queen's Parade.",
