    description:
      "The big picture.\n\nWho says a family home can't take your breath away? This 704sqm, two-storey residence blends space and comfort with beautifully appointed design. A split-level, open plan kitchen, living and dining room with a gas fireplace connects to an expansive outdoor deck with built-in barbecue, so you can entertain guests all year round. And adjoining this \u00e2\u20ac\u201c a double-sized indoor spa!\n\nThe finer details.\n\nThis stunning home is complemented by manicured front and back gardens with mature trees and a waterfall feature. The master and adjacent bedrooms, and connecting balcony, offer impressive views out to the CBD, and a sixth bedroom or study. Stained glass windows from the original 1920s build and feature lighting throughout add to the sense of opulence.\n\nThe extras.\n\nHere is an address worthy of the residence. Tucked away in a quiet, verdant pocket of Hawthorn East, 4 Nicholson Street enjoys peaceful surroundings just 1km from Camberwell Junction. Sir William Angliss Reserve is also just 600m up the road, while Fritsch Holzer Park is a 1km stroll from home. And there are many of the city's best schools nearby.\n\n• Large lawn in back gardens\n• Split-level deck with in-built barbecue\n• Downstairs basement storage (under decking)\n• Indoor double-sized spa room with television capabilities and en suite\n• Floor to ceiling windows and glass doors leading to deck in living and spa room\n• Separate second dining room\n• Front sitting room\n• Large island bench in kitchen\n• Ample kitchen storage\n• Ilve appliances & Miele dishwasher\n• QASAIR rangehood\n• Master bedroom with walk-in robe and en suite\n• Secondary bedrooms with built-in robes\n• Front porch overlooking garden\n• Air conditioning\n• Enclosed clothesline with extra storage space\n• 2 car spaces with hidden storage in carport roof",
