    description:
      "The big picture.\n\nThis expansive family residence is the embodiment of the word 'charming'. Whether you are spreading out in the spacious and sunlight-drenched living and dining room, or cooking up a storm in the refurbished kitchen, you're sure to savour life's every moment in this cosy home. Plus, there's the generous backyard just made for garden get-togethers.\n\nThe finer details.\n\nYou'll soon find that this home is full of little surprises. First, it comes with a permit for two townhouses side by side (subject to council approval) \u00e2\u20ac\u201c for those looking to boost the long-term investment appeal. Then there's also the separate workshop space, for any artists wanting a private studio to practise their craft.\n\nThe extras.\n\nCity convenience - meet natural beauty. Situated on approx. 651sqm in a quiet, leafy pocket of Doncaster East, the residence is only a few minutes' walk from Tunstall Square. Families with kids can pop around the corner to the playground of Aintree Reserve, and just 1.5km to the north, Cat Jump Park offers a picturesque green space that's perfect for morning jogs or afternoon footy games.\n\n• Polished floorboards in the kitchen\n• Main bed with en suite and built-in robes\n• Gas ducted heating and split system air conditioning\n• Secure double carport\n• Covered store & workshop\n• Water tank\n• General residential zone \u00e2\u20ac\u201c schedule 1\n• Easy access to buses, the Eastern Freeway and Westfield\n• Near to Donburn Primary School and East Doncaster Secondary College",
