    description:
      "The big picture.\n\nNature is the word when it comes to this stunning town residence. Designed by Kavellaris Urban Design (KUB - Architecture), this luxurious residence is defined by the natural stone and timber that form the exterior and weave through the interior. Add a verdant courtyard that connects to a spacious open plan living, dining and kitchen area, and this home feels positively tranquil.\n\nThe finer details.\n\nIt's not often we come across a town residence such as this. Once you ascend the magnificent timber staircase, a rumpus room makes a perfect kids' play area or additional sitting room. Both upstairs bedrooms come with private en suites, while the master bedroom features mirrored highlights that contrast boldly with the subtle grain of the timber built-in robes and stand-alone headboard.\n\nThe extras.\n\nSituated right in the heart of the Harcourt Estate with all the facilities at your doorstep. Surrounded by some of the finest schools Melbourne has to offer, with Carey Grammar, MLC and Ruyton Girls' School within a walking distance just to name a few. Additionally you're only a short stroll to Burke or Glenferrie Road shops, cafes, restaurants and transport.\n\n• Generous proportions\n• Stone benchtop in kitchen\n• Miele & ILVE appliances\n• Remote double garage\n• Secure entry\n• Ducted heating and cooling throughout",
