    description:
      "The big picture.\n\nIt's not often that an apartment can evoke such a natural scene, but this Hawthorn East home is awash in the greenery that the suburb is famed for. Climbing planters cover the building's exterior, while treetops can be viewed through every window. But it's the expansive, north-facing balcony that offers a true verdant oasis, as copious planters line the walls and spill from the roof. Just in time for a spring party?\n\nThe finer details.\n\nBefore you say anything, don't worry \u00e2\u20ac\u201c the interiors are just as impressive. Thanks to the residence's orientation, the open plan kitchen, dining and lounge area receives abundant natural light throughout the day. Every bedroom offers built-in robes, while the master also joins with a private en suite. The appealing internal size is 110sqm and 41sqm of outdoor entertainment space. Finally, a colour scheme of white, timber and charcoal offers a striking contrast to the greenery throughout.\n\nThe extras.\n\nThe tale of natural beauty doesn't end there, as this home gains its namesake from the beloved Anderson Park, just moments down the road. Heading 100m east, Burke Road offers cafés, restaurants, boutiques and trams to the CBD. It's also only a little over 1km to Camberwell Junction \u00e2\u20ac\u201c so it's easy to stroll home after a Saturday night cinema outing or a meal at a local favourite.\n\n• Lounge connects to balcony through glass doors, ideal for indoor-outdoor entertainment\n• Clever storage throughout\n• Large island benchtop in kitchen\n• Freestanding bath\n• Split system air conditioning\n• Boutique apartment building",
